script: |
  super -f text -I q115.spq | sort > q115.out

inputs:
  - name: q115.spq
    data: |
      SELECT DISTINCT + - col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( NOT ( NOT - col0 * - 45 NOT BETWEEN NULL AND - 92 ) );
  - name: tab1

outputs:
  - name: q115.out
    data: |
      -51
      -85
      -91
